import colors from "./colors";

const customLabelStyles = {
  colorFocused: colors.primary,
  fontSizeFocused: 12,
  topFocused: -30,
  leftFocused: -10,
  leftBlurred: -10,
  colorBlurred: "#bcbcbc",
  backgroundColor: "transparent",
};

export default customLabelStyles;
